import ItemList from '../Merchant/ItemList/ItemList'
import CreateItem from '../Merchant/CreateItem/CreateItem';
import EditForm from './Edit/EditForm'
import EditContainer from './Edit/EditContainer'
import OrderListContainer from './AllOrders/OrderListContainer'
import LogedInNavbar from './Navbar/LogedInNavbar'
import {Route, Link, Redirect, Switch} from 'react-router-dom'
export default class UserSuperContainer extends Component {
    // When loged in render the dashbard first
    // Navbar
        // create item
        // Item list
            // Each item one Edit container
        // Orderlist containers
        // Edit container conatins edit form
    render() {
        return (
            <>
                <div className="navbar">
                    <div>Image here</div>
                    <Link className="login break" >Item List</Link>
                    <Link className="login" >Create Item</Link>
                    <Link className="login" >Edit Items</Link>
                    <Link className="login" >Edit Items</Link>
                    <Link className="login" >Edit Items</Link>

                </div>
                <ItemList />
                <CreateItem />
                <EditForm />

                <EditContainer />
                <OrderListContainer />
            </>
        )
    }
}
